Excelente condomínio no edifício de centro empresarial Jatobá!

Edifício corporativo referência na região Batel. O edifício Jatobá divide-se em 16 andares estruturados, forro modular, sistema de ar condicionado central, 05 elevadores de acesso, 01 vaga de garagem, portaria 24h. Esquina da Av. Silva Jardim com a R. Pasteur. O empreendimento fica situado ao centro da região Batel, conhecida por sua qualidade em infraestrutura.

Ideal para farmácias, bancos, academias e outros.
Obs: nesse local já foi o antigo banco Citibank.

Detalhes:
Loja térrea medindo:
área total: 519,72m 
área privativa: 396,15m 
área comum: 75,85m 
garagem: 47,72 m - sala em vão livre e drywall (pode ser retirado);
- sala de máquinas;
- 3 salas separadas;
- bwc feminino e masculino;
- bwc para deficiente físico;
- cozinha com armários e pia;
- piso em cerâmica e carpet;
-02 vagas de garagem.

pronto para você abrir seu negócio.

